import React from 'react';
import './button.css';

function Button(props) {
  const { name } = props;

  return (
    <div>
      {name.map((n, index) => (
        <button key={index} type="button" className={`button-${index}`}>
          Hi! {n}
        </button>
      ))}
    </div>
  );
}

export default Button;
